import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 59.1-325 Fees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/59.1-325.md","filePath":"vacode/59.1-325.md"}'),o={name:"vacode/59.1-325.md"},i=r('<h1 id="§-59-1-325-fees" tabindex="-1">§ 59.1-325 Fees. <a class="header-anchor" href="#§-59-1-325-fees" aria-label="Permalink to &quot;§ 59.1-325 Fees.&quot;">​</a></h1><p>A. Each application for registration under § <a href="http://law.lis.virginia.gov/vacode/59.1-318/" target="_blank" rel="noreferrer">59.1-318</a> shall be accompanied by a reasonable fee to be determined by the Board and published in the regulations adopted in accordance with the provisions of the Administrative Process Act (§ <a href="http://law.lis.virginia.gov/vacode/2.2-4000/" target="_blank" rel="noreferrer">2.2-4000</a> et seq.).</p><p>B. Each application for registration or for amendment shall be accompanied by a reasonable fee to be determined by the Board and published in regulations adopted in accordance with the provisions of the Administrative Process Act.</p><p>C. Until such time as regulations covering fees are adopted by the Board, the registration fee shall be $2,500 and the fee for amendments shall be $100.</p><p>D. All fees shall be remitted to the State Treasurer and shall be credited to a special fund of the Virginia Department of Agriculture and Consumer Services to be used in the administration of this chapter.</p><p>1985, c. 409; 1988, c. 58; 1992, c. 545.</p>',6),n=[i];function s(d,c,l,h,p,f){return a(),t("div",null,n)}const b=e(o,[["render",s]]);export{m as __pageData,b as default};
